import { ADD_SHOW, FETCH_SHOWS } from "./actionTypes";

export const addShow = showObj => ({
    type: ADD_SHOW, payload: showObj
})

export const getShows = () => {
    return function (dipatch) {
        console.log("first dispatch invoked")
        fetch("http://localhost:3000/api/v1/events")
            .then(resp=>resp.json())
            .then(data => console.log)
    }
}

// dispatch({ type: GET_SHOWS, payload: data })
